The troubled life and career of one of Norway's most celebrated artists
is examined with documentary-style realism. Following a rough
chronology from 1884 to 1894, focusing on the influences that shaped
his art, particularly the prevalence of disease and death in his family and
his youthful affair with a married woman. 

